import expenses from "./components/expensesDummyDB";
import ExpenseItem from "./ExpenseItem";

const Expenses = () => {
  const newExpenses = [];
  expenses.forEach((expense) => {
    newExpenses.push(
      <div>
        <ExpenseItem expense={expense} />
      </div>
    );
  });
  return newExpenses;
};
export default Expenses;
